    const location = useLocation();
  return (
    <>
    <div className={styles.back}>
    <Link to='/'>
      <span>Back</span>
    </Link>
    </div>

  <div className={styles.nav}>
  <Link to='/'><span>Home</span></Link>
  <Link to='/Recipes'><span>Recipes</span></Link>
  </div>
  </>

  );
}

export default NavBar;
